import React from 'react';
import './Sidebar.css';
import logo from './logo.png';

function Sidebar() {
  return (
    <div className="Sidebar">
      this is the Sidebar
      <img alt="logo" className='Sidebar_image' src={logo}/>
    </div>
  );
}

export default Sidebar;
